var cvar, tvar;
var letters3 = [];
var thirdinit = false;
maketimeout(0);

function maketimeout(k) {
	setTimeout(function() {
		makeletters3(k);
	}, 10);
}

function makeletters3(g) {
	letters3[g] = [];
	for (var h = 0; h < 26; h++) {
		letters3[g][h] = [];
		for (var i = 0; i < 26; i++) {
			cvar = tvar = 0;
			letters3[g][h][i] = [];
			for (var j = 0; j < 26; j++) {
				cvar += weights3[g][h][i][j];
			}
			for (var j = 0; j < 26; j++) {
				tvar += weights3[g][h][i][j];
				letters3[g][h][i][j] = tvar / cvar * 1000;
			}
		}
	}
	if (g == 25) {
		var o = document.createElement('option');
		$('#ordersel').append(o);
		o.text = '3';
		o.value = '3';
		o.selected = 'selected';
	} else {
		maketimeout(g + 1);
	}
}
